import React from "react";
import './photohouse.css'

export const PhotoHouse = (props) =>{
    return(
        <div className='card-container'>
            <div className='block-photo'>
                    <img src={props.img} style={{height:'70px'}} alt=''/>
            </div>
        </div>
    )
}
